import React, {Suspense} from 'react';
import {Canvas} from "@react-three/fiber";

import {WhitePill} from "./components/Models/WhitePill";
import Header from './components/Header/Header';
import IntroSection from './components/IntroSection/IntroSection';
import BenefitsSection from './components/BenefitsSection/BenefitsSection';
import GameSection from './components/GameSection/GameSection';

import './App.css';
import {Ethereum} from "./components/Models/Ethereum";

function App() {
  return (
    <div className="page-wrapper">
      {/*<Header />*/}
      {/*<IntroSection />*/}
      {/*<BenefitsSection />*/}
      {/*<GameSection />*/}
      <Canvas style={{width: '100px',}} camera={{position: [0, 1, 5], zoom: 4}}>
        <ambientLight intensity={0.3}/>
        <spotLight intensity={0.3} angle={0.1} penumbra={1} position={[5, 25, 2]}/>
        <Suspense fallback={null}>
          <WhitePill />
        </Suspense>
      </Canvas>
    </div>
  );
}

export default App;
